use bytes::BufMut;
use ds::RingSlice;
use protocol::Bit;
use protocol::Packet;
use protocol::redis::HandShakeStatus::Init;
use protocol::redis::ResponseContext;

#[test]
fn parse_rsp() {
    let data: RingSlice = SIMPLE_ARR.as_bytes().into();
    let data: Packet = data.into();
    let mut ctx = ResponseContext {
        oft: 0,
        bulk: 0,
        status: Init,
    };
    assert!(data.skip_multibulks_with_ctx(&mut ctx).is_ok());
    assert_eq!(ctx.oft, data.len());
    assert_eq!(ctx.bulk, 0);

    ctx.oft = 0;
    assert!(data.skip_multibulks_with_ctx(&mut ctx).is_ok());
    assert_eq!(ctx.oft, data.len());
    assert_eq!(ctx.bulk, 0);
}

#[test]
fn parse_command_rsp() {
    let rsp = "*2\r\n*6\r\n$5\r\nhost:\r\n:-1\r\n*2\r\n+loading\r\n+stale\r\n:0\r\n:0\r\n:0\r\n*6\r\n$11\r\nunsubscribe\r\n:-1\r\n*4\r\n+pubsub\r\n+noscript\r\n+loading\r\n+stale\r\n:0\r\n:0\r\n:0\r\n";
    let rsp_data: RingSlice = rsp.as_bytes().into();
    let rsp_data: Packet = rsp_data.into();
    let mut ctx = ResponseContext {
        oft: 0,
        bulk: 0,
        status: Init,
    };
    assert!(rsp_data.skip_multibulks_with_ctx(&mut ctx).is_ok());
    assert_eq!(ctx.oft, rsp_data.len());
    assert_eq!(ctx.bulk, 0);

    ctx.oft = 0;
    assert!(rsp_data.skip_multibulks_with_ctx(&mut ctx).is_ok());
    assert_eq!(ctx.oft, rsp_data.len());
    assert_eq!(ctx.bulk, 0);
}

