fn response_skip_multibulks(data: &[u8]) {
    let mut ctx = ResponseContext {
        oft: 0,
        bulk: 0,
        status: Init,
    };
    for i in 1..(data.len() - 1) {
        let data = data[..i].to_vec();
        let rsp_data: RingSlice = RingSlice::from_vec(&data);
        let rsp_data: Packet = rsp_data.into();
        let r = rsp_data.skip_multibulks_with_ctx(&mut ctx);
        assert!(
            r.is_err(),
            ": data_len:{} ctx:{:?}",
            rsp_data.len(),
            ctx
        );
    }
    let rsp_data: RingSlice = data[..].into();
    let rsp_data: Packet = rsp_data.into();
    let r = rsp_data.skip_multibulks_with_ctx(&mut ctx);
    assert!(r.is_ok());
    assert_eq!(ctx.oft, rsp_data.len());
    assert_eq!(ctx.bulk, 0);
}

